import React from 'react';

class EquipementGare extends React.Component {
    state = {}
    render() {
        console.log(this.props.data)
        if (this.props.data[0] !== "nom" && this.props.data[0] !== "code") {
            return (
                <div>
                    <p>{this.props.data[0]}</p>
                    <p>{this.props.data[1]}</p>
                </div>

            )
        } else {
            return null
        }

    }
}

export default EquipementGare;
